import React, { Component } from "react";

class TodoList extends Component {
  render() {
    return (
      <div>
        <div>
          <input /> <button> 提交 </button>
        </div>
        <ul>
          <li>xueyingyu</li>
          <li>buxue</li>
        </ul>
      </div>
    );
  }
}

export default TodoList;
